function RenderTeethFront(n,t,i){var u=document.getElementById(t),r;if(u!=null){i=","+i;u.innerHTML="";let f="";if(n&&n.length>0)for(r=0;r<16;r++){let t=n[r],e=","+t.ID+",",u="";u=i.includes(e)==!0?'<div class="column" style="height: 70px"><img style="min-width: 30px" src="/assests/img/TeethTab/'+t.UrlImage+'.png"><div class="ui checkbox" style="margin: 5px"><input type="checkbox" value="'+t.ID+'" class="checkTeeth" data-id="'+t.ID+'"/><label class="coloring red"><\/label><\/div><\/div>':'<div class="column" style="height: 70px"><img style="opacity:0.3;min-width: 30px" src="/assests/img/TeethTab/'+t.UrlImage+'.png"><\/div>';f=f+u}document.getElementById(t).innerHTML=f}EventLinkClick_CheckBoxList()}function RenderTeethBellow(n,t,i){var u=document.getElementById(t),r;if(u!=null){i=","+i;u.innerHTML="";let f="";if(n&&n.length>0)for(r=16;r<32;r++){let t=n[r],e=","+t.ID+",",u="";u=i.includes(e)==!0?'<div class="column"><div class="ui checkbox" style="margin: 5px"><input type="checkbox" value="'+t.ID+'" class="checkTeeth" data-id="'+t.ID+'" /><label class="coloring red"><\/label><\/div><img style="min-width: 30px" src="/assests/img/TeethTab/'+t.UrlImage+'.png"><\/div>':'<div class="column"><div style="height: 29px;"><\/div><img style="opacity:0.3;min-width: 30px" src="/assests/img/TeethTab/'+t.UrlImage+'.png"><\/div>';f=f+u}document.getElementById(t).innerHTML=f}EventLinkClick_CheckBoxList()}function renderLaboTemplate(n,t){var u=document.getElementById(t),i,r;if(u!=null){u.innerHTML="";let f="";if(n&&n.length>0)for(i=0;i<n.length;i++){let u=n[i],e=u.Quiz,t="<div class='groupItem'  style='display:flex;"+u.style+"'>";for(r=0;r<e.length;r++)itemQuiz=e[r],t=t+renderLaboQuestions(itemQuiz);t=t+"<\/div>";f=f+t}document.getElementById(t).innerHTML=f}}function renderLaboQuestions(n){let t="";t='<div style="width:'+n.percent+"%; "+n.style+'"><span class="header">'+n.title+'<\/span><div class="content '+n.vector+'" >';let i=n.listitems;if(i&&i.length>0)for(var r=0;r<i.length;r++){let n=i[r];t=t+RenderItemCheckList(n)}return t=t+"<\/div><\/div>"}function RenderItemCheckList(n){let t="";switch(n.type){case"checkbox":t=t+'<div class="field"><div class="ui checkbox"><input type="checkbox" class="checkQA" value="small" id="'+n.id+'" data-id="'+n.id+'"><label for="'+n.id+'">'+n.label+"<\/label><\/div><\/div>";break;case"checkboxOther":t=t+'<div class="field"><div class="ui checkbox"><input type="checkbox" class="checkQA" value="small" id="'+n.id+'" data-id="'+n.id+'"><label><input type="text" placeholder="Other answers..." id="other'+n.id+'" onchange="getValueCheckboxOther('+n.id+')"><\/label><\/div><\/div>';break;case"checkbox_fillnumber":t=t+'<div class="field"><div class="ui checkbox" style="display: inline-flex"><input type="checkbox" class="checkQA" value="small" id="'+n.id+'" data-id="'+n.id+'"><label>'+n.label+'<input type="text" style="max-width: '+n.width+'; padding-left: 10px" class="no-outline" placeholder="" id="other'+n.id+'" onchange="getValueCheckboxOther('+n.id+')">'+n.unit+"<\/label><\/div><\/div>";break;case"header":t=t+'<div class="field"><label class="header">'+n.text+"<\/label><\/div>";break;case"text":t=t+'<div class="field"><label style="color: rgba(0,0,0,.87);transition: color .1s ease;font-size: 1em;">'+n.text+"<\/label><\/div>";break;case"checkbox_img":t=t+'<div class="column" style="position: relative;padding:10px 10px 30px 10px"><img src="/assests/img/pontic/'+n.link+'" class="ui image"><label>'+n.title+'<\/label><br/><div class="ui checkbox" style="position: absolute;bottom: 0;left: 50%;transform: translateX(-50%)"><input type="checkbox" name="small" id="'+n.id+'" class="checkQA" data-id="'+n.id+'" /><label><\/label><\/div><\/div>';break;case"img":t=t+'<div class="column" style="position: relative;padding:10px 10px 30px 10px"><img style="'+n.style+'" src="/assests/img/pontic/'+n.link+'" class="ui image"><\/div>';break;case"lable_note":t=t+'<div class="field" style="display:flex;white-space: nowrap;"><span class="header">'+n.label+'<\/span><input type="text" style=" padding-left: 10px" class="no-outline" placeholder="" id="'+n.id+'" onchange="getAnswerDataType_Note('+n.id+')"><\/div>';break;case"textarea":t=t+'<textarea id="'+n.id+'" onchange="getAnswerDataType_Note('+n.id+')" name="content" style="max-height: 1em"><\/textarea>'}return t}function EventLinkClick_TeethCheck(){$(".checkTeeth").change(function(){let n=0;var t=document.getElementsByClassName("checkTeeth");for(let i=0;i<t.length;i++)t[i].checked&&(n=n+1);$("#Labo_Unit").val(n);ChangingEvent_Labo()})}function EventLinkClick_CheckBoxList(){$(".checkQA").on("click",function(){var n=$(this).attr("data-id"),i,t;if(this.checked==!1){for(let t=dataAnswerLabo.length-1;t>=0;t--)if(dataAnswerLabo[t].id==n){dataAnswerLabo.splice(t,1);break}}else if(i=document.getElementById("other"+n),i){if(t=$("#other"+n).val()?$("#other"+n).val():"",t!=""){let i={type:"checkother",id:n,text:t};dataAnswerLabo.push(i)}}else{let t={type:"checkbox",id:n};dataAnswerLabo.push(t)}})}function ChangingEvent_Labo(){let n=$("#Labo_Unit").val()?Number($("#Labo_Unit").val()):0,t=$("#Labo_Unit_Price").val()?Number($("#Labo_Unit_Price").val()):0;$("#Labo_Total_Price").val(n*t)}function loadAnswerUpdate(){}function getValueCheckboxOther(n){if(AnswerID_Other="other"+n,$("#"+n).is(":checked")){let i={};var t=$("#"+AnswerID_Other).val()?$("#"+AnswerID_Other).val():"";let r=dataAnswerLabo.filter(t=>t.id==n);if(r!=undefined&&r!=null&&r.length!=0){for(let t=dataAnswerLabo.length-1;t>=0;t--)if(dataAnswerLabo[t].id==n){dataAnswerLabo.splice(t,1);break}i={type:"checkother",id:n,text:t}}else i={type:"checkother",id:n,text:t};dataAnswerLabo.push(i)}}function getAnswerDataType_Note(n){var t=$("#"+n).val()?$("#"+n).val():"";let i={type:"note",id:n,text:t};dataAnswerLabo.push(i)}function FillTeethWhenUpdate(n){if(n!=""){$("#teethChoosing").show();var t=document.getElementsByClassName("checkTeeth"),i=n.split(",");for(let n=0;n<t.length;n++)for(let r=0;r<i.length;r++)t[n].value==i[r]&&(t[n].checked=!0)}}